import React from "react";
import { Renko } from "recharts";
import renkoChartData from "./RenkoChartData.json";

const RenkoChartComponent = () => {
  return (
    <Renko width={500} height={300} data={renkoChartData} />
  );
};

export default RenkoChartComponent;
